bioghist.p:
De taakomschrijving van de Kamers werd vanaf 1963 als volgt gedefinieerd: 'Behartiging van de economische belangen van handel en industrie, ambacht en dienstverlening in hun gebied.' Deze taak kan worden onderverdeeld in een drietal gebieden:  


de voorlichting en dienstverlening aan het bedrijfsleven (voorlichtende taak);


de uitvoering van een aantal economische wetten (uitvoerende taak);


de pleit- en adviesfunctie jegens de overheid ( beleidsadviserende taak).

Andere wetten en taken waarbij de Kamers zijn betrokken:  


Handelsnaamwet;


Winkelsluitingswet;


Wet opruiming en uitverkopen;


Wet op het afbetalingsstelsel;


Wet beperking cadeaustelsel;


Colportagewet;


Wet op de Kansspelen;


Woonruimtewet;


Wet autovervoer goederen;


Wet autovervoer personen;


Legalisatie van handtekeningen;


Beëdigingen van makelaars;


Verenigingen- en stichtingenregister.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 


U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;


Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;


In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;


Vervolgens bevestigt u uw reservering door deze te versturen.
